import React, { useState } from "react";
import Header from "./components/Header";
import Filters from "./components/Filters";
import EVTypeChart from "./components/Charts/EVTypeChart";
import RangeChart from "./components/Charts/RangeChart";
//import Map from "./components/Map";
import data from "./data/evData.json";
import "./styles/dashboard.css";

const App = () => {
  const [filteredData, setFilteredData] = useState(data);

  return (
    <div className="app">
      <Header />
      <div className="grid grid-cols-1 md:grid-cols-4 gap-6 mt-6">
        {/* Filters */}
        <div className="col-span-4 md:col-span-1">
          <Filters data={data} setFilteredData={setFilteredData} />
        </div>

        {/* Charts and Map */}
        <div className="col-span-4 md:col-span-3 grid grid-cols-1 md:grid-cols-2 gap-6">
          <div className="chart-card">
            <EVTypeChart data={filteredData} />
          </div>
          <div className="chart-card">
            <RangeChart data={filteredData} />
          </div>
          {/* <div className="map-card col-span-1 md:col-span-2">
            <Map data={filteredData} />
          </div> */}
        </div>

        {/* Display Vehicle Data */}
        <div className="col-span-4 grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6 mt-6">
          {filteredData.map((vehicle, index) => (
            <div className="data-card" key={index}>
              <h2>{vehicle.Make} {vehicle.Model}</h2>
              <div className="card-data">
                <span><span className="label">VIN:</span> {vehicle["VIN (1-10)"]}</span>
                <span><span className="label">County:</span> {vehicle.County}</span>
                <span><span className="label">City:</span> {vehicle.City}</span>
                <span><span className="label">Electric Range:</span> {vehicle["Electric Range"]} miles</span>
                <span><span className="label">CAFV Eligibility:</span> {vehicle["Clean Alternative Fuel Vehicle (CAFV) Eligibility"]}</span>
                <span><span className="label">Electric Utility:</span> {vehicle["Electric Utility"]}</span>
                <span><span className="label">Postal Code:</span> {vehicle["Postal Code"]}</span>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default App;
